webpackJsonp([97],{328:function(e,t){e.exports={data:{config:{siteMetadata:{title:"Bricolage",author:"Kyle Mathews"}},markdown:{id:"/Users/kylemathews/programs/blog/pages/2008-04-22---ive-been-accepted-to-google-summer-of-code/index.md",bodyHTML:'<p>I\'m very excited to announce that I\'ve been accepted to participate in the <a href="http://en.wikipedia.org/wiki/Google_Summer_of_Code">Google Summer of Code</a> program. I will be writing <a href="http://en.wikipedia.org/wiki/Memetracker">memetracking</a> software that will enable anyone to set up a <a href="http://news.google.com">Google News</a> or <a href="http://techmeme.com">Techmeme</a> like site on any topic. Do you want to develop a news site following economic news? You can with my software. Do you want a site that tracks the latest Facebook Application development news? You can do that with my software. <a href="/drupal-memetracker-module-my-google-summer-of-code-application/">Read my full application</a> for more about what the memetracker will do.</p>\n<p>A big thanks to those who will be helping me write this software. First to Google who sponsors the Summer of Code program. Then to my mentors from the <a href="http://drupal.org">Drupal</a> community (<a href="http://www.funnymonkey.com/">Bill Fitzgerald</a>, <a href="http://wundo.net/">Fabiano Sant\'Ana</a>, and <a href="http://scotthadfield.ca/">Scott Hadfield</a>). Then the <a href="http://byu.edu">BYU</a> Professors who\'ve volunteered to help me (<a href="https://cs.byu.edu/faculty/giraudcarrier_christophe">Christophe Giraud-Carrier</a> and <a href="http://axon.cs.byu.edu/Dan/">Dan Ventura</a>) and Ph.D student <a href="http://dml.cs.byu.edu/~smitty/">Matt Smith</a>.</p>\n<p>It\'s going to be a great summer! I\'ll be posting updates on this blog as summer rolls on.</p>\n',frontmatter:{readNext:null,title:"I've been accepted to Google Summer of Code",tags:["drupal","memetracker","google summer of code"],date:"April 21, 2008"}}},pathContext:{path:"/ive-been-accepted-to-google-summer-of-code/",component:"/Users/kylemathews/programs/blog/pages/blog-post.js"}}}});
